 INSERT INTO srdb.assessment VALUES('WGNSSK-WHITNS-VIId-IIIa-1979-2006-MINTO', 'WGNSSK', 'WHITNS-VIId-IIIa', 'MINTO', '2008-04-14', '2010-03-15 21:49:52', '1979-2006', 'http://www.ices.dk/products/CMdocs/CM-2007/CM2007.pdf', 'NULL', 'Prior to 1996 whiting in these areas were assessed separately. Given the problem with the interpretation of historical stock trends, ICES considers that the current state of the stock, with respect to biological reference points, is unknown. Industrial by-catch as activity in the norway pout and sandeel fisheries.', 'ICES-WGNSSK-2007.pdf', 1, 1, 'XSA', 'Due to the lack of concordance in the data pre-dating the early 1990s, the working group considers that it is not possible categorically to classify the current state of the stock with reference to precautionary reference points as the biomass reference points are derived from a consideration of the stock dynamics at a time when the commercial catch-at-age data and the survey data conflict.', '../spreadsheets/MINTO-WHITNS-VIId-IIIa-2007-editedDR-QAQC-revised.xls') ; 
